import React, { useState } from 'react';
import axios from 'axios';
import HomeButton from "../device/HomeButton";

const UserInsert = () => {
    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');
    const [role, setRole] = useState('');

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            const user = {
                username: username,
                password: password,
                role: role,  // Ensure role is included
            };

            const response = await axios.post('http://localhost:8080/users/insert', user);
            alert(`User created with ID: ${response.data}`);
        } catch (error) {
            console.error('Error inserting user:', error);
            alert('Error inserting user');
        }
    };

    return (
        <div>
            <HomeButton />
            <form onSubmit={handleSubmit}>
                <label>Username:</label>
                <input type="text" value={username} onChange={(e) => setUsername(e.target.value)} />

                <label>Password:</label>
                <input type="password" value={password} onChange={(e) => setPassword(e.target.value)} />

                <label>Role:</label>
                <input type="text" value={role} onChange={(e) => setRole(e.target.value)} />

                <button type="submit">Insert User</button>
            </form>
        </div>
    );
};

export default UserInsert;
